import { useDispatch } from "react-redux";
import { useEffect, useState } from "react";

import { setLoading } from "@redux";
import { historyApi } from "@api";
import { IBenefit, ICoupon, IReward } from "@interfaces";
import { enumTypes } from "@configs";
import { ComponentHistoryList } from "@components";

export const ModuleHistory = () => {
    //page hooks
    const dispatch = useDispatch();
    //page state
    const [histories, setHistories] = useState<(IBenefit | IReward | ICoupon)[]>();
    useEffect(() => {
        (async () => {
            dispatch(setLoading(true));
            const res = await historyApi.getListHistory();
            const data = res.data.docs.map((item: any) => {
                if (item.type === enumTypes.REWARD || item.type === enumTypes.BENEFIT) {
                    return {
                        exchangedType: item.exchangedType,
                        idCart: item._id,
                        updatedAtHistory: item.updatedAt,
                        ...item.reward,
                    };
                } else if (item.type === enumTypes.COUPON) {
                    return {
                        exchangedType: item.exchangedType,
                        idCart: item._id,
                        updatedAtHistory: item.updatedAt,
                        ...item.qrtable,
                    };
                }
            }) as (IBenefit | IReward | ICoupon)[];
            setHistories(data);
            dispatch(setLoading(false));
        })();
    }, []);
    const handleClick = async (id: string) => {
        const res = await historyApi.getListHistoryDetailById(id);
        console.log(res);
    };
    return <>{histories && <ComponentHistoryList handleClick={handleClick} data={histories} />}</>;
};
